description:
Category	Feature

Director	Harry Sparks
Starring	Tony de Sergio, Jodi West, Callie Calypso, Payton Simmons, T Stone

Jennifer (Callie Calypso) is like any normal 18-year-old high school senior. She lives at home with her father (Tony De Sergio), enjoys hanging out with her best friend Tracy (Payton Simmons), and loves her boyfriend Danny (T. Stone). But Jennifer's life abruptly changes when she becomes entangled in a passionate affair with Grace (Jodi West), her sexy new stepmother. Tensions rise when Jennifer has second thoughts and tries to end the relationship, but Grace refuses to let go. In this groundbreaking feature lenght erotic thriller, a stepdaughter's steamy affair with her stepmother leads to unexpected and terrifying repercussions!

